import React from "react";
import ReactDOM from "react-dom";
import Header from "./Header.js"

function MainContent() {

    return (
        <div>
            <h1>
                Sa moara Jaxaneta de nu munceste Bula orice.
            </h1>
            <ol>
                <li>ReactJS cica</li>
                <li>asta din video ma plictiseste</li>
                <li>video ul e bun dar nu e structurat chiar bine</li>
                <li>macar invat ceva nou</li>
            </ol>
        </div>
    )
}
function Page() {

    return (

        <div>
            <Header />
            <MainContent />
            <Footer />
        </div>

    )
}


function Footer() {

    return (
        <footer>
            <small>
                EidriiaN all rights reserved.
            </small>
        </footer>
    )

}


ReactDOM.render(<Page />, document.getElementById("root"))


